import React, {Component} from 'react';
//引入组件
import {Link} from "react-router-dom";
//引入样式

import '../../publicstyle/publicstyle.css';

//引入样式
import './xdbox.scss';
class Ttbox extends Component {
    render() {
        return (
            <div className="search">
                {/*搜索*/}
                    <Link to="/search" className="search-input">
                        <span className="search-icon iconfont icon-sousuo"></span>
                        <span className="search-text"> 搜索饿了么商家、商品名称</span>

                    </Link>
            </div>
        );
    }
}

export default Ttbox;
